import React from "react";

// export a home page component
export default class Item extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
        title:props.title,
        columnnum: props.columnnum,
        rownum : props.rownum,
        key: props.key
    };
  }

  render() {
    return (
      <div className="Item" columnnum={this.props.columnnum} rownum={this.props.rownum}>
        {this.state.title}
      </div>
        );
  }
}
